(self.webpackChunkdemo=self.webpackChunkdemo||[]).push([[46994],{46994:n=>{n.exports='<p>Right-click any table row.</p>\n\n<table tuiTable>\n    <thead tuiTHead>\n        <tr tuiThGroup>\n            <th\n                *ngFor="let column of tableColumns"\n                tuiTh\n            >\n                {{ column }}\n            </th>\n        </tr>\n    </thead>\n    <tbody tuiTbody>\n        <tr\n            *ngFor="let rowInfo of tableData"\n            #dropdown="tuiDropdown"\n            tuiDropdownContext\n            [tuiDropdown]="contextMenu"\n        >\n            <td\n                *ngFor="let value of getObjectValues(rowInfo)"\n                tuiTd\n            >\n                {{ value }}\n            </td>\n\n            <ng-template #contextMenu>\n                <tui-data-list\n                    role="menu"\n                    tuiDataListDropdownManager\n                    class="context-menu"\n                >\n                    <button\n                        *ngFor="let item of menuItems"\n                        tuiOption\n                        type="button"\n                        (click)="printToConsole(item.title, rowInfo); dropdown.toggle(false)"\n                    >\n                        {{ item.title }}\n                        <tui-icon\n                            class="icon"\n                            [icon]="item.iconName"\n                        />\n                    </button>\n\n                    <button\n                        iconEnd="@tui.chevron-right"\n                        tuiDropdownAlign="right"\n                        tuiDropdownSided\n                        tuiOption\n                        type="button"\n                        [tuiDropdown]="nestedMenu"\n                    >\n                        More\n                    </button>\n                </tui-data-list>\n\n                <ng-template #nestedMenu>\n                    <tui-data-list>\n                        <button\n                            *ngFor="let option of moreOptions"\n                            tuiOption\n                            type="button"\n                        >\n                            {{ option }}\n                        </button>\n                    </tui-data-list>\n                </ng-template>\n            </ng-template>\n        </tr>\n    </tbody>\n</table>\n'}}]);